import sun.plugin.javascript.navig.Link;

import java.util.*;
import java.util.stream.Stream;

public class GraphDictionaryOfWords {
    static boolean difference_by_one_char(String str1,String str2){
        int difference = 0;
        for(int i=0;i<str1.length();i++){
            if(str1.charAt(i)!=str2.charAt(i)) difference ++;
        }
        return difference ==1;
    }

    static String[] pushStopToEnd(String[] words,String stop){
        for(int i=0;i<words.length;i++){
            if(words[i].equals(stop)){
                swap(words,i,words.length-1);
            }
        }
        if (!words[words.length-1].equals(stop)) {
            ArrayList<String> alstr = new ArrayList<>(Arrays.asList(words));
            alstr.add(stop);
            return alstr.toArray(new String[alstr.size()]);
        }
        return words;
    }
    static void swap(String[] words,int i,int j){
        String temp = words[i];
        words[i] =  words[j];
        words[j] = temp;
    }

    static String[] string_transformation(String[] words, String start, String stop) {
        Queue<Integer> q = new LinkedList<>();
        Map<Integer,Integer> path = new HashMap<>();
        ((LinkedList<Integer>) q).add(-1);
        words =pushStopToEnd(words,stop);
        while (!q.isEmpty()){
            int currIdx = q.poll();
            String currword = start;
            if(currIdx !=-1){
                currword = words[currIdx];
            }
            for(int i=0;i<words.length;i++) {
                if (!path.containsKey(i) && difference_by_one_char(words[i],currword)){
                    ((LinkedList<Integer>) q).add(i);
                    path.put(i,currIdx);

                }
            }
        }
    return buildPath(words,path,start,stop);
    }
    static String[] buildPath(String[] words,Map<Integer,Integer> path,String start,String stop){

        String currStr = stop;
        LinkedList<String> pathList = new LinkedList<>();
        if(path.containsKey(words.length-1)) {
            pathList.add(0, stop);
            int curridx = words.length - 1;
            while (path.get(curridx) != -1) {
                curridx = path.get(curridx);
                pathList.add(0, words[curridx]);

            }
            pathList.add(0, start);
        }
        else pathList.add("-1");
        return pathList.toArray(new String[pathList.size()]);
    }
    public static void main(String args[]){
        //String[] words = {"cat", "hat", "bad", "had"};
        String[] words ={"",
                         "",
                         "",
                         "",
                         ""};
        String start = "";
        String stop =  "";
        String[]  ans =string_transformation(words,start,stop);
        for(String s : ans){
            System.out.println( s);
        }
    }
}
